['오래된 유적에서 발견된 신기한 캡슐을 뽑을 수 있는 곳입니다.\n\n캡슐을 뽑기위해서는 유타칸의 장인들이 가공한 {@YELLOW}캡슐 코인{@DEFAULT}이 필요합니다.\n캡슐중에는 {@YELLOW}전설 드래곤{@DEFAULT}과 같이 희귀한 상품이 들어있는 것도 있어 테이머들에게 늘 인기입니다.']='Bu gadymy harabalyklardan tapylan syrly kapsulalary çekip boljak ýer. \n \ n kapsulalary çekmek üçin Ututakan dünýäsinde demirçiler tarapyndan gaýtadan işlenýän { {@YELLOW} } kapsula teňňeleri {@DEFAULT} gerek. }.',
